import axios from 'axios';

const API = axios.create({
    baseURL: `https://pixabay.com/api/?key=`,
    header: { 
       'Accept': 'application/json',
       'Content-type': 'application/json' 
    }, 
    params: {
        key: process.env.PIXABAY_API_KEY
    },
})

export default API;
